#define muculloch pitts
class McCulloch_Pitts_neuron():

  def __init__(self , weights , threshold):
    self.weights = weights    #define weights
    self.threshold = threshold    #define threshold

  def model(self , x):
    #define model with threshold
    if self.weights @ x >= self.threshold:
        return 1
    else:
        return 0

#define model for dataset
def XOR(input):
  neur1 = McCulloch_Pitts_neuron([1, 1], 0.5)
  neur2 = McCulloch_Pitts_neuron([-1, -1], -1.5)
  neur3 = McCulloch_Pitts_neuron([1, 1], 1.5)

  z1 = neur1.model(np.array([input[0], input[1]]))
  z2 = neur2.model(np.array([input[0], input[1]]))
  z3 = neur3.model(np.array([z1, z2]))

  # 3 bit output
  # return str(z1) + str(z2)
  return list([z1, z2, z3])

import itertools
# inputs
input = [1, 0]
X = list(itertools.product(input, input))

for i in X:
    res = XOR(i)
    print("XOR with input as", str(i[0]) + str(" ")+str(i[1]), "goes to output ", str(res[2]))

